import React from 'react';

const BannerAd = () => {
	return (
		<div id="banner-ad">
			<div class="banner-ad">
				<a href="#" class="banner-ad__href"><img
					src="img/Webp.net-resizeimage-min.jpg"
					src={require('../../assets/img/Webp.net-resizeimage-min.jpg')}
					alt=""
					class="banner-ad__img"
				/></a>
				<span class="banner-ad__txt">Your Add</span>
			</div>
		</div>
	);
}

export default BannerAd;
